import { Link } from 'react-router-dom';
import {ShoppingOutlined, SettingOutlined,AppstoreOutlined } from '@ant-design/icons';
import { Menu } from 'antd';
function getItem(label, key, icon, children, type) {
  return {
    key,
    icon,
    children,
    label,
    type,
  };
}
const items = [
  getItem('化妆品', '化妆品', <ShoppingOutlined style={{fontSize: '30px', color: 'orange' }}/>, [
    getItem('sk2', '1'), getItem('haba', '2'),
  ]),
  getItem('Navigation Two', 'sub2', <AppstoreOutlined />, [
    getItem('Option 5', '5'),
    getItem('Option 6', '6'),
    getItem('Submenu', 'sub3', null, [getItem('Option 7', '7'), getItem('Option 8', '8')]),
  ]),
  {
    type: 'divider',
  },
  getItem('Navigation Three', 'sub4', <SettingOutlined />, [
    getItem('Option 9', '9'),
    getItem('Option 10', '10'),
  ]),
];
const Nav = () => {
  const onClick = (e) => {
    if(e===1){
      return <Link to="/makeups/sk2">化妆品</Link>
    };
  };
  return (
    <Menu
      onClick={onClick}
      style={{
        width: 120,
      }}
      defaultSelectedKeys={['1']}
      defaultOpenKeys={['sub1']}
      mode="inline"
      items={items}
    />
  );
};
export default Nav;
